  false,\n\t\"url\": null,\n\t\"notes\": \"USGS Contract: G10PC00013 Task Order Number:
  G12PD00264 Prepared for USGS, Prepared by: Dewberry, 1000 Ashley Blvd., Suite 801,
  Tampa, Florida 33602-3718 The LiDAR data were processed to a bare-earth digital
  terrain model (DTM). Detailed breaklines and bare-earth Digital Elevation Models
  (DEMs) were produced for the project area. Deliverables were produced in both UTM
  and State Plane coordinates. The data was formatted according to tiles with each
  UTM tile covering an area of 1,000 meters by 1,000 meters and each State Plane tile
  covering an area of 2,500 feet by 2,500 feet. A total of 797 UTM tiles and 1,338
  State Plane tiles were produced for the project encompassing an area of approximately
  277 sq. miles. Classified points include: Class 1 (unclassified), Class 2 (ground),
  Class 7 (noise), Class 9 (water), Class 10 (ignored ground due to breakline proximity).\",\n\t\"owner_org\":
